import React from "react";
import ReactDOM from "react-dom";

const Hello = (props) => (
  <div>
    <p>
      Hello {props.name}, you are {props.age} years old.
    </p>
  </div>
);

const App = () => {
  const name = "Riza";
  const age = 23;
  return (
    <div>
      <Hello name="Maisie" age={25 + 10} />
      <Hello name={name} age={age} />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
